import React from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head";
import SignUpForm from "../components/SignUpForm";

useEffect(() => {
  if (!(me && me.id)) {
    Router.push("/");
  }
}, [me && me.id]);

const signup = () => {
  return (
    <AppLayout>
      <Head>
        <title>signup | nodeBird</title>
      </Head>
      <SignUpForm />
    </AppLayout>
  );
};

export default signup;
